package main.java.reservoirComputing;

public class ComputationOutOfMemoryError extends Exception {

	public ComputationOutOfMemoryError() {
		// TODO Auto-generated constructor stub
	}

	public ComputationOutOfMemoryError(String message) {
		super(message);
	}

	public ComputationOutOfMemoryError(Throwable cause) {
		super(cause);
	}

	public ComputationOutOfMemoryError(String message, Throwable cause) {
		super(message, cause);
	}

	public ComputationOutOfMemoryError(String message, Throwable cause,
			boolean enableSuppression, boolean writableStackTrace) {
		super(message, cause, enableSuppression, writableStackTrace);
	}

}
